-- Table localidad
CREATE TABLE localidad(
	id INT NOT NULL,
	nombre VARCHAR(200) NOT NULL,
	PRIMARY KEY (id));

-- Table grupo_racial
CREATE TABLE grupo_racial(
	id INT NOT NULL,
	nombre VARCHAR(200) NOT NULL,
	PRIMARY KEY (id));

-- Table tipo
CREATE TABLE tipo(
	id INT NOT NULL,
	nombre VARCHAR(200) NOT NULL,
	PRIMARY KEY (id));

-- Table sistema
CREATE TABLE sistema(
	id INT NOT NULL,
	nombre VARCHAR(200) NOT NULL,
	PRIMARY KEY (id));

-- Table calidad
CREATE TABLE calidad(
	id INT NOT NULL,
	descripcion VARCHAR(200) NOT NULL,
	PRIMARY KEY (id));

-- Table carne
CREATE TABLE carne(
	id INT NOT NULL,
	canal_frio_der VARCHAR(100) NOT NULL,
	canal_frio_izq VARCHAR(100) NOT NULL,
	ojo_chuleta VARCHAR(100) NOT NULL,
	grosor_grasa_dorsal VARCHAR(100) NOT NULL,
	calidad_id INT,  
	PRIMARY KEY (id),
	FOREIGN KEY(calidad_id) REFERENCES calidad (id));

-- Table animal
CREATE TABLE animal(
	id INT NOT NULL,
	edad INT NOT NULL,
	kpv INT NOT NULL,
	tipo_id INT NOT NULL,
	localidad_id INT NOT NULL,
	carne_id INT NOT NULL,
	grupo_racial_id INT NOT NULL,
	sistema_id INT NOT NULL,
	PRIMARY KEY(id),
	FOREIGN KEY(localidad_id) REFERENCES localidad (id),
	FOREIGN KEY(carne_id) REFERENCES carne (id),
	FOREIGN KEY(grupo_racial_id) REFERENCES grupo_racial (id),
	FOREIGN KEY(sistema_id) REFERENCES sistema (id));

-- Table atributos_carne
CREATE TABLE atributos_carne(
	id INT NOT NULL,
	descripcion VARCHAR(200) NOT NULL,
	PRIMARY KEY (id));

-- Table calidad_atributos_carne
CREATE TABLE calidad_atributos_carne(
	carne_id INT NOT NULL,
	calidad_id INT NOT NULL,
	atributos_carne_id INT NOT NULL,
	PRIMARY KEY(carne_id,calidad_id,atributos_carne_id),
	FOREIGN KEY(carne_id) REFERENCES carne (id),
	FOREIGN KEY(calidad_id) REFERENCES calidad (id),
	FOREIGN KEY(atributos_carne_id) REFERENCES atributos_carne (id));

	
